import React from "react";
import {
  GoogleMap,
  withScriptjs,
  withGoogleMap,
  Marker,
} from "react-google-maps";

const myMap = (props) => {
  return (
    <GoogleMap
      defaultZoom={10}
      defaultCenter={{
        lat: 33.684566,
        lng: -117.826508,
      }}
    >
      {props.isMarkerShown && (
        <Marker position={{ lat: -34.397, lng: 150.644 }} />
      )}
    </GoogleMap>
  );
};

const wrappedMap = withScriptjs(withGoogleMap(myMap));
export default wrappedMap;
